targets.queryText:
query {
 data:storageBuckets {
    acceptingNewBags
    id
    operatorMetadata {
      nodeLocation {
        coordinates {
          latitude
          longitude
        }
        city
        countryCode
      }
}}}

query {
data:workers(
    where: { createdAt_lt: "$end_time", group: { id_eq: "storageWorkingGroup" }, terminatedworkereventworker_none: { createdAt_gte: "$end_time", createdAt_lte: "$start_time"}}) {
   workerId:runtimeId
   isLead
   membership {
   id
   handle
   }
   rewardPerBlock
   rewardAccount
   terminatedworkereventworker {
      createdAt
    }
   }
   }

query {
  data:storageBuckets( where: {  createdAt_lt: "$end_time"} ) {
    id
    operatorStatus {
      ... on StorageBucketOperatorStatusActive {
        workerId
      }
    }
    acceptingNewBags
    dataObjectCountLimit
    dataObjectsSizeLimit
    dataObjectsCount
    dataObjectsSize
    operatorMetadata {
      nodeEndpoint
      nodeLocation {
        city
        countryCode
      }
    }

  }

}

query  {
  data:rewardPaidEvents(limit: 33000, offset: 0, where: {group: {id_eq: "storageWorkingGroup"}, createdAt_gt: "$start_time", createdAt_lt: "$end_time"}) {
      workerId
      worker {
      membership {
        handle
      }
    }
    amount
  }
}

query  { 
data:openingFilledEvents   (where: {group: {id_eq: "storageWorkingGroup"}, createdAt_gt: "$start_time", createdAt_lt: "$end_time"}) { createdAt  workersHired { id membershipId}}
}
